Fucking DungeonFD - May 11, 2012 - Maia Davis  Mp4 + Pics


This week DungeonCorp is excited to bring you Part One of a two part location storyline shoot: &quot;Prowler&quot;. Enjoy!...Southern California is full of lovely, independent ladies. Such is the case with Maia, a dazzling, young blonde, out for a leisurely jog. After a nice workout, she comes home to her quiet abode for a little cool down time. Unbeknownst to her however...there's somebody else inside. A cool, refreshing drink is just the ticket on a hot day. And then maybe a shower...and as she makes her way to get freshened up, the stranger springs...What happens next is a whirlwind of events as Maia finds herself in this intruder's grip. She knows not who this madman is, but she has a feeling that she had better comply...


